   "source": [
    "### Description of the columns\n",
    "\n",
    "| Column Name    | Description                                                                                  | Data Type  | Example             |\n",
    "|----------------|----------------------------------------------------------------------------------------------|------------|---------------------|\n",
    "| SAMPLE         | Unique identifier for the sequenced sample.                                                  | String     | Sample1, Sample2    |\n",
    "| CHROM          | Chromosome where the variant is located.                                                      | String     | 1, 2, X, Y          |\n",
    "| POS            | Genomic position of the variant on the chromosome.                                            | Integer    | 12345               |\n",
    "| REF            | Reference base at the position in the reference genome.                                       | String     | A, C, G, T          |\n",
    "| ALT            | Alternate base(s) observed in the sequencing reads.                                            | String     | T, C, A, G          |\n",
    "| FILTER         | Reason(s) why the variant call might be unreliable (e.g., low quality, technical artifacts). | String     | PASS, LowQual       |\n",
    "| DP             | Total depth of coverage at the position (number of reads covering the position).             | Integer    | 100                 |\n",
    "| REF_DP         | Depth of coverage supporting the reference allele.                                             | Integer    | 80                  |\n",
    "| ALT_DP         | Depth of coverage supporting the alternate allele(s).                                           | Integer    | 20                  |\n",
    "| AF             | Allele frequency - proportion of reads supporting the alternate allele(s).                    | Float      | 0.2                 |\n",
    "| GENE           | Gene potentially affected by the variant (may be empty if not annotated).                     | String     | ORF1ab, S           |\n",
    "| EFFECT         | Predicted functional impact of the variant on the protein or transcript.                       | String     | missense_variant, synonymous_variant |\n",
    "| HGVS_C         | Human Genome Variation Society cDNA-level annotation.                                          | String     | c.1234A>T           |\n",
    "| HGVS_P         | Human Genome Variation Society protein-level annotation.                                        | String     | p.Ala415Val         |\n",
    "| HGVS_P_1LETTER | Single-letter code for the protein-level effect.                                                | String     | p.N51S              |\n",
    "| CALLER         | Software tool used to call the variant.                                                        | String     | bcftools, GATK      |\n"
   ]
  },
