   "source": [
    "# Variant counts across samples\n",
    "variant_counts_per_sample <- table(variants_csv_tb$SAMPLE)\n",
    "\n",
    "# Plotting with color based on sample type and adding a legend\n",
    "barplot(variant_counts_per_sample, main = \"Variant Counts Across Samples\", \n",
    "        xlab = \"Samples\", ylab = \"Variant Count\", \n",
    "        col = sample_colors)\n",
    "\n",
    "# Adjusting the legend size\n",
    "legend(\"topright\", legend = names(sample_colors), fill = sample_colors, \n",
    "       title = \"Sample\", cex = 1.2) # Change cex for adjusting legend size"
   ]
